import directExpenses from './november/charts/direct-expenses';
import totalExpenses from './november/charts/total-expenses';
import general from './november/tables/general';
import aheadActivities from './november/tables/summary-of-main-activities/ahead-activities';
import lateActivities from './november/tables/summary-of-main-activities/late-activities';

interface IMainActivities {
  item: string;
  activity: string;
  prev: string;
  real: string;
  physical_deviation: string;
}

interface IChartData {
  bars: Array<{
    color: string;
    name: string;
    data: number[];
  }>;
  categories: Array<string>;
}

interface IBuild {
  month: {
    directExpenses: IChartData;
    totalExpenses: IChartData;
    general: Array<object>;
    aheadActivities: IMainActivities[];
    lateActivities: IMainActivities[];
  };
}

export default {
  november: {
    directExpenses,
    totalExpenses,
    general,
    aheadActivities,
    lateActivities,
  },
} as IBuild;
